import React, {useState} from 'react';
import { Link } from 'react-router-dom';

function NavBar() {
  return(
    <>
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          CUDHAO <i className='fab fa-typo5' />
        </Link>
      </div>
    </nav>
  </>
  );
}

export default NavBar;
